using System;
using System.Collections.Generic;
using System.Linq;

class Program
{
    static void Main()
    {
        string[] s = Console.ReadLine().Split();
        long l = long.Parse(s[0]);
        long r = long.Parse(s[1]);
        long x = long.Parse(s[2]);
        long y = long.Parse(s[3]);
        List<long> yfactors = Factor(y);
        List<long> yf = new List<long>();
        long x2 = x;
        for (int i = 0; i < yfactors.Count; i++)
        {
            if (x2 % yfactors[i] == 0)
            {
                x2 /= yfactors[i];
            }
            else if (i != 0 && yfactors[i] == yfactors[i - 1])
            {
                yf[yf.Count - 1] *= yfactors[i];
            }
            else
            {
                yf.Add(yfactors[i]);
            }
        }
        if (x2 != 1)
        {
            Console.WriteLine("0");
        }
        else
        {
            Console.WriteLine(Count(new bool[yf.Count], 0, l, r));
        }
    }

    public static long Count(bool[] b, long at, long l, long r)
    {
        if (at == b.Length)
        {
            long n = x, m = x;
            for (int i = 0; i < b.Length; i++)
            {
                if (b[i])
                    n *= yf[i];
                else
                    m *= yf[i];
            }
            if (n <= r && n >= l && m <= r && m >= l)
            {
                return 1;
            }
            else
                return 0;
        }
        long e = 0;
        bool[] nb = new bool[b.Length];
        Array.Copy(b, nb, b.Length);
        nb[at] = false;
        e += Count(nb, at + 1, l, r);
        nb[at] = true;
        e += Count(nb, at + 1, l, r);
        return e;
   }

    public static List<long> Factor(long n)
    {
        List<long> r = new List<long>();
        while (n % 2 == 0)
        {
            n /= 2;
            r.Add(2);
        }
        while (n % 3 == 0)
        {
            n /= 3;
            r.Add(3);
        }

        long sqrtn = (long)(Math.Sqrt(n)) + 1;
        long i = 6;
        while (n > 1 && i <= sqrtn)
        {
            bool nc = false;
            long a;
            while ((a = n % (i - 1)) == 0)
            {
                r.Add(i - 1);
                n /= i - 1;
                nc = true;
            }
            while ((a = n % (i + 1)) == 0)
            {
                r.Add(i + 1);
                n /= i + 1;
                nc = true;
            }
            i += 6;
            if (nc)
                sqrtn = (long)(Math.Sqrt(n)) + 1;
        }
        if (n != 1) r.Add(n);
        return r;
    }
}
